import React, { useState, useEffect } from "react";
import {
  Route,
  Switch,
  withRouter,
  useHistory,
  Redirect,
} from "react-router-dom";
import Header from "./Header";
import Main from "./Main";
import Footer from "./Footer";
import Login from "./Login";
import Register from "./Register";
import EditProfilePopup from "./EditProfilePopup";
import EditAvatarPopup from "./EditAvatarPopup";
import AddPlacePopup from "./AddPlacePopup";
import PopupWithImage from "./PopupWithImage";
import PopupWithForm from "./PopupWithForm";
import { CurrentUserContext } from "../contexts/CurrentUserContext";
import api from "../utils/api";
import auth from "../utils/auth";
import ProtectedRoute from "./ProtectedRoute";
import InfoToolTip from "./InfoToolTip";

function App() {
  const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] = useState(false);
  const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = useState(false);
  const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] = useState(false);
  const [isInfoToolTipOpen, setIsInfoToolTipOpen] = useState(false);

  const [selectedCard, setSelectedCard] = useState(null);
  const [currentUser, setCurrentUser] = useState(null);
  const [cards, setCards] = useState([]);
  const [loggedIn, setLoggedIn] = useState(false);

  const [authPopupState, setAuthPopupState] = React.useState(false);
  const [mode, setMode] = useState(false);
  const [message, setMessage] = useState({ message: "" });

  const [userEmail, setUserEmail] = React.useState("");
  const [userPassword, setUserPassword] = React.useState("");

  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [registered, setRegistered] = useState(false);
  const [token, setToken] = useState(localStorage.getItem("token"));

  const history = useHistory();

  function handleEditProfileClick() {
    setIsEditProfilePopupOpen(true);
  }
  function handleAddPlaceClick() {
    setIsAddPlacePopupOpen(true);
  }
  function handleEditAvatarClick() {
    setIsEditAvatarPopupOpen(true);
  }
  function handleCardClick(card) {
    setSelectedCard(card);
  }
  function closeAllPopups() {
    setIsAddPlacePopupOpen(false);
    setIsEditProfilePopupOpen(false);
    setIsEditAvatarPopupOpen(false);
    setSelectedCard(null);
    setIsInfoToolTipOpen(false);
  }

  function handleUpdateUser({ name, about }) {
    api
      .updateProfile({ name, about }, token)
      .then((res) => {
        setCurrentUser(res.data);
      })
      .catch((err) => console.log(err));
    closeAllPopups();
  }

  function handleUpdateAvatar({ avatar }) {
    api
      .updateAvatar(avatar.current.value, token)
      .then((res) => {
        setCurrentUser(res.data);
      })
      .catch((err) => console.log(err));
    closeAllPopups();
  }

  function handleCardLike(card) {
    // Check one more time if this card was already liked
    const isLiked = card.likes.includes(currentUser._id);

    // Send a request to the API and getting the updated card data
    api
      .changeLikeCardStatus(card._id, isLiked, token)
      .then((newCard) => {
        // Create a new array based on the existing one and putting a new card into it
        const newCards = cards.map((c) => (c._id === card._id ? newCard : c));
        // Update the state
        setCards(newCards);
      })
      .catch((err) => console.log(err));
  }

  function handleCardDelete(card) {
    api
      .deleteCard(card._id, token)
      .then(() => {
        setCards(cards.filter((c) => c._id !== card._id));
      })
      .then((res) => closeAllPopups())
      .catch((err) => console.log(err));
  }

  function handleAddPlace({ title, link }) {
    api
      .addNewCard({ title, link }, token)
      .then((newCard) => {
        setCards([newCard.data, ...cards]);
      })
      .then((res) => closeAllPopups())
      .catch((err) => console.log(err));
  }

  //resetForm
  function resetForm() {
    setUserEmail("");
    setUserPassword("");
  }

  //login
  function closePopup() {
    setAuthPopupState(false);
  }

  function renderSuccess() {
    setMode(true);
    setAuthPopupState(true);
    setMessage({ message: "¡Correcto! Ya estás registrado." });
  }

  function renderFailure() {
    setMode(false);
    setAuthPopupState(true);
    setMessage({
      message: "Uy, algo salió mal. Por favor, inténtalo de nuevo.",
    });
  }

  function handleLogin() {
    setLoggedIn(true);
  }

  function authorize(e) {
    e.preventDefault();
    auth
      .authorize(userEmail, userPassword)
      .then((data) => {
        if (data && data.token) {
          setToken(data.token);
          localStorage.setItem("token", data.token);
          handleLogin();
          history.push("/main");
        } else {
          resetForm();
          if (!email || !password) {
            renderFailure();
            throw new Error(
              "400 - one or more of the fields were not provided"
            );
          }
          if (!data) {
            renderFailure();
            throw new Error(
              "401 - the user with the specified email not found"
            );
          }
        }
      })
      .catch((err) => console.log(err.message));
  }

  function handleRegisterSubmit(e) {
    e.preventDefault();
    auth
      .register(userEmail, userPassword)
      .then((res) => {
        //  if (!(res.data && res.data._id)) {
        if (!(res && res._id)) {
          renderFailure();
          // throw new Error(`400 - ${res.message ? res.message : res.error}`);
          // throw new Error(
          //   `409(Conflict)  - ${res.message ? res.message : res.error}`
          // );
          if (res.status === 409) {
            return Promise.reject(new Error("(Conflict) - User already taken"));
          }
        } else {
          renderSuccess();
        }
      })
      .then((res) => {
        setRegistered(true);
        history.push("/signin");
        return res;
      })
      .then(resetForm)
      .catch((err) => console.log(err));
  }

  function signOut() {
    localStorage.removeItem("token");
    setLoggedIn(false);
    setUserEmail("");
    history.push("/signin");
  }

  useEffect(() => {
    if (token) {
      auth
        .getContent(token)
        .then((res) => {
          setLoggedIn(true);
          setUserEmail(res.data.email);
        })
        .catch((err) => console.log(err));
    } else {
      setLoggedIn(false);
    }
  }, [token]);

  useEffect(() => {
    api
      .getUserInfo(token)
      .then((res) => {
        setCurrentUser(res.data);
        api
          .getInitialCards(token)
          .then((res) => {
            if (res.data) {
              setCards((cards) => res.data);
              // setCards((cards) => [...cards, res.data]);
            }
          })
          .catch((err) => console.log(err));
      })
      .catch((err) => console.log(err));
  }, [token]);

  return (
    <CurrentUserContext.Provider value={currentUser}>
      <Switch>
        <Route exact path="/signin">
          <div className="loginContainer">
            <Login
              loggedIn={loggedIn}
              title="Iniciar Sesión"
              value="¿Aún no eres miembro? Regístrate aquí"
              link="/signup"
              redirect="Regístrate"
              setLoggedIn={setLoggedIn}
              signOut={signOut}
              renderFailure={renderFailure}
              renderSuccess={renderSuccess}
              authorize={authorize}
              userEmail={userEmail}
              userPassword={userPassword}
              setUserEmail={setUserEmail}
              setUserPassword={setUserPassword}
            />
            <InfoToolTip
              popupState={authPopupState}
              closePopup={closePopup}
              message={message}
              mode={mode}
            />
          </div>
        </Route>
        <Route exact path="/signup">
          <Header
            userEmail={userEmail}
            loggedIn={loggedIn}
            link={{ description: "Log in", to: "/signin" }}
          />
          <Register
            registered={registered}
            email={email}
            setEmail={setEmail}
            password={password}
            setPassword={setPassword}
            handleRegisterSubmit={handleRegisterSubmit}
            setUserEmail={setUserEmail}
            handleLogin={handleLogin}
          />
          <InfoToolTip
            isOpen={isInfoToolTipOpen}
            onClose={closeAllPopups}
            loggedIn={loggedIn}
          />
        </Route>
        <Route exact path="/">
          {loggedIn ? <Redirect to="/main" /> : <Redirect to="/signin" />}
        </Route>
        <Route path="/main">
          <EditProfilePopup
            isOpen={isEditProfilePopupOpen}
            onClose={closeAllPopups}
            onUpdateUser={handleUpdateUser}
          />
          <EditAvatarPopup
            isOpen={isEditAvatarPopupOpen}
            onClose={closeAllPopups}
            onUpdateAvatar={handleUpdateAvatar}
          />
          <AddPlacePopup
            isOpen={isAddPlacePopupOpen}
            onClose={closeAllPopups}
            onAddPlace={handleAddPlace}
          />
          <PopupWithForm
            name="confirmation"
            title="Are you sure?"
            isOpen={false}
            onClose={closeAllPopups}
          />
          <PopupWithImage onClose={closeAllPopups} card={selectedCard} />
          <Header
            loggedIn={loggedIn}
            userEmail={userEmail}
            link={{ description: "Log out", to: "/signin" }}
          />
          <ProtectedRoute
            path="/main"
            loggedIn={loggedIn}
            component={Main}
            onEditProfile={handleEditProfileClick}
            onAddPlace={handleAddPlaceClick}
            onEditAvatar={handleEditAvatarClick}
            onCardClick={handleCardClick}
            onCardLike={handleCardLike}
            onCardDelete={handleCardDelete}
            onClose={closeAllPopups}
            isEditProfilePopupOpen={isEditProfilePopupOpen}
            isAddPlacePopupOpen={isAddPlacePopupOpen}
            isEditAvatarPopupOpen={isEditAvatarPopupOpen}
            selectedCard={selectedCard}
            cards={cards}
          />
        </Route>
        <Redirect from="*" to="/" />
      </Switch>
      <Footer />
    </CurrentUserContext.Provider>
  );
}

export default withRouter(App);
